DROP TABLE IF EXISTS "student";
DROP TABLE IF EXISTS "promo";

CREATE TABLE IF NOT EXISTS "promo" (
  "id" INT NOT NULL PRIMARY KEY,
  "name" VARCHAR(128),
  "github_organization" VARCHAR(255)
);


CREATE TABLE IF NOT EXISTS "student" (
  "id" SERIAL PRIMARY KEY,
  "first_name" VARCHAR(128),
  "last_name" VARCHAR(128),
  "github_username" VARCHAR(255),
  "profile_picture_url" VARCHAR(255),
  "promo_id" INT REFERENCES "promo"("id")
);


-- Ses 3 lignes permettent de rajouter un auto incrément sur l'id de la table promo
-- En repartant du dernier id de la table promo

-- La séquence est ce qui enregistre le dernier id de la table
CREATE SEQUENCE promo_id_seq;

-- Je précise que la séquence doit commencer au dernier id de la table + 1
SELECT setval('promo_id_seq', COALESCE((SELECT MAX(id)+1 FROM promo), 1), false);

-- Finalement, j'ajoute l'auto incrémentation sur l'id de la table promo
ALTER TABLE promo ALTER COLUMN id SET DEFAULT nextval('promo_id_seq');
